import React, { Component } from 'react';
import './Cart.css';
import './Roll.css';

class Cart extends Component {
  render() {
    console.log("this.props.cart", this.props.cart)
    return (
        <div className={this.props.className}>
          <p>Shopping Cart ({this.props.itemCount} items)</p>
          <p>Total: $ {this.props.totalPrice}</p>
          {this.props.cart.map((rollInCart) => 
            {
              return (
                  <div>
                    {/* <img src={rollInCart.imageURL} className="roll-picture" alt={`a ${rollInCart.rollName}`} /> */}
                    <b> {rollInCart.rollName} </b>
                  </div>
                )
            })
          }

        </div>

    );
  }
}

export default Cart;
